import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


class Row extends React.Component{
	render(){
		return(
			<li>Basic line</li>
		);
	}
}

class List extends React.Component{
	render(){
		return(
			<ul>
				<Row />
			</ul>
		);
	}
}


ReactDOM.render(<List />, document.getElementById('root'));
